The Hitman (2004 Digital Playground) [WebDL]

Alexa Rae, Dolorian, Jessica Drake &amp; Sunrise Adams

Alexa Rae, Jessica Drake and Barrett Blade star in this killer comedy about a hit man whose conscience won't allow him to hurt the many women he has been ordered to take out. Rather than have them sleep with the fishes, he has them sleep with him, much to the disappointment of his crime boss. Super hot sex scenes and a little fate lend a helping hand in this edgy comedy by acclaimed director, Robby D.

